// FileUpload.js
import React, { useState } from 'react';

const PdfUpload = ({ onFileUpload }) => {
  const handleFileChange = (e) => {
    const file = e.target.files[0];
    onFileUpload(file);
  };

  return (
    <div>
      <input type="file" onChange={handleFileChange} accept=".pdf" />
    </div>
  );
};

export default PdfUpload;
